type
  PathMode = enum  # the different Curve types
    PMline,          # Line
    PMcurve,        # Cubic bezier

type 
  PathBuf = ref object
    pen: Vec2[float]
    points: seq[Vec2[float]]
    curves: seq[Curve]
    relative: bool
    mode: PathMode

proc addline(buf: var PathBuf) =
  var c = newLine()

  c.b = buf.points.pop()
  c.a = buf.points.pop()
  buf.curves.add(c)

proc addcurve(buf: var PathBuf) =
  var c = newCubicBezier()

  c.b3 = buf.points.pop()
  c.b2 = buf.points.pop()
  c.b1 = buf.points.pop()
  c.b0 = buf.points.pop()
  buf.curves.add(c)

proc closepath(buf: var PathBuf) =
  var c = newLine()

  if buf.curves[^1].kind == ckLine:
    c.a = buf.curves[^1].b
  if buf.curves[^1].kind == ckBezier:
    c.a = buf.curves[^1].b3

  if buf.curves[0].kind == ckLine:
    c.b = buf.curves[0].a
  if buf.curves[0].kind == ckBezier:
    c.b = buf.curves[0].b0

  buf.curves.add(c)

proc add_coordinates(buf: var PathBuf, x: float, y: float) =
  if buf.relative:
    if len(buf.points) > 0:
      buf.points.add(buf.pen+vec2(x,y))
    else:
      buf.points.add(vec2(x,y))
      buf.pen = vec2(x,y)
  else:
    buf.points.add(vec2(x,y))
    buf.pen = vec2(x,y)

  if buf.mode == PMline:
    if len(buf.points) == 2:
      buf.pen = buf.points[^1]
      buf.addline()
      buf.points.add(buf.pen)
  elif buf.mode == PMcurve:
    if len(buf.points) == 4:
      buf.pen = buf.points[^1]
      buf.addcurve()
      buf.points.add(buf.pen)
  

let parser = peg("path", buf: PathBuf):
  space <- ' '

  exponent <- ('e'|'E') * ?'-' * +Digit

  number <- ?'-' * +Digit * ?('.' * +Digit) * ?exponent

  coordinate_pair <- (>number * ',' * >number) | (>number * ' ' * >number * ?space) :
    buf.add_coordinates(parseFloat($1), parseFloat($2))

  vert_rel <- 'h' * ?space * >number:
    #if abs(parseFloat($1)) > 1e-6:
      buf.relative = false
      buf.mode = PMline
      buf.add_coordinates(buf.pen[0] + parseFloat($1), buf.pen[1])
    #else:
    #  echo("parsepath.nim: skipped 'h' with zero relative movement")
  vert_abs <- 'H' * ?space * >number:
    buf.relative = false
    buf.mode = PMline
    buf.add_coordinates(parseFloat($1), buf.pen[1])
  horz_rel <- 'v' * ?space * >number:
    #if parseFloat($1) > 1e-6:
      buf.relative = false
      buf.mode = PMline
      buf.add_coordinates(buf.pen[0], buf.pen[1] + parseFloat($1))
    #else:
    #  echo("parsepath.nim: skipped 'v' with zero relative movement")
  horz_abs <- 'V' * ?space * >number:
    buf.relative = false
    buf.mode = PMline
    buf.add_coordinates(buf.pen[0], parseFloat($1))
  line_rel <- 'l' * ?space * >number * ',' * >number:
    #if (abs(parseFloat($1)) > 1e-6) or (abs(parseFloat($2)) > 1e-6):
      buf.relative = true
      buf.mode = PMline
      buf.add_coordinates(parseFloat($1), parseFloat($2))
    #else:
    #  echo("parsepath.nim: skipped 'l' with zero relative movement")
  line_abs <- 'L' * ?space * >number * ',' * >number:
    buf.relative = false
    buf.mode = PMline
    buf.add_coordinates(parseFloat($1), parseFloat($2))


  coordinates <- (coordinate_pair | vert_rel | vert_abs | horz_rel | horz_abs | line_rel | line_abs) * space


  moveto_rel <- 'm' * ?space:
    buf.relative = true
    buf.mode = PMline

  moveto_abs <- 'M' * ?space:
    buf.relative = false
    buf.mode = PMline

  curveto_rel <- 'c' * ?space:
    buf.relative = true
    buf.mode = PMcurve

  curveto_abs <- 'C' * ?space:
    buf.relative = false
    buf.mode = PMcurve

  close_path <- 'Z' | 'z':
    buf.closepath()

  command <- (moveto_rel | moveto_abs | curveto_rel | curveto_abs) * +coordinates

  start <- (moveto_rel | moveto_abs) * +coordinates

  path <- start * *(command) * *close_path



proc newPathBuf(): PathBuf = 
  result = PathBuf()
  result.pen = vec2(0.0, 0.0)
  result.points = @[]
  result.curves = @[]
  result.relative = true


proc parse_path*(data: string): seq[Curve] =
  var buf = newPathBuf()

  let r = parser.match(data, buf)
  result = buf.curves


